    TResult Function(AccountNotActivated<State, OtherStates> value)?
        accountNotActivated,
    TResult Function(UnauthorizedAccess<State, OtherStates> value)?
        unauthorizedAccess,
    TResult Function(ServerError<State, OtherStates> value)? serverError,
    TResult Function(UnexpectedDataError<State, OtherStates> value)?
        unexpectedDataError,
    TResult Function(ForbiddenAccess<State, OtherStates> value)? forbidden,
    required TResult orElse(),
  }) {
    if (forbidden != null) {
      return forbidden(this);
    }
    return orElse();
  }
}

abstract class ForbiddenAccess<State, OtherStates>
    implements Failure<State, OtherStates> {
  const factory ForbiddenAccess() = _$ForbiddenAccess<State, OtherStates>;
}
